	private static Block register(Block block) {
		VERSIONED_REGISTRY.computeIfAbsent(block.getVersion(), i -> new HashMap<>()).put(block.getId(), block);
		VERSIONED_ID_REGISTRY.computeIfAbsent(block.getVersion(), i -> new HashMap<>()).put(block.getIdentifier(), block);
		LATEST_REGISTRY.computeIfPresent(block.getId(),(id,old)->old.getVersion().isOlderThan(block.getVersion())?block:old);
		LATEST_ID_REGISTRY.computeIfPresent(block.getIdentifier(),(id,old)->old.getVersion().isOlderThan(block.getVersion())?block:old);
		return block;
	}
